    return(
        <Router>
            <Header />

            <Container>
                <Row>
                    <Col md={9}>Center</Col>
                    <Col md={3}>Sidebar</Col>
                </Row>
            </Container>

        </Router>
    )
};

function Home(){
    return(
        <div>
            Home
        </div>
    )
}

export default App;
